import React, { useState } from "react";

import { Navbar, NavLink } from "react-bootstrap";

import "./NavigationBar.css";

const NavigationBar = () => {
	const [currentPage, setCurrentPage] = useState("");

	return (
		<div className="navigation-bar">
			<div className="logo">Mindustry Tool</div>
			<Navbar>
				<NavLink
					href="/home"
					className={"page-" + (currentPage == "home" ? "active" : "inactive")}
					onClick={() => {
						setCurrentPage("home");
					}}
				>
					Home
				</NavLink>
				<NavLink
					href="/schematic"
					className={"page-" + (currentPage == "schematic" ? "active" : "inactive")}
					onClick={() => {
						setCurrentPage("schematic");
					}}
				>
					Schematic
				</NavLink>
				<NavLink
					href="/map"
					className={"page-" + (currentPage == "map" ? "active" : "inactive")}
					onClick={() => {
						setCurrentPage("schematic");
					}}
				>
					Schematic
				</NavLink>
				<NavLink
					href="/schematic"
					className={"page-" + (currentPage == "schematic" ? "active" : "inactive")}
					onClick={() => {
						setCurrentPage("schematic");
					}}
				>
					Schematic
				</NavLink>
			</Navbar>
		</div>
	);
};

export default NavigationBar;
